field.sifPath:
The field is determined based on grade level of student on the survey period start date. 'enrYog' is retrieved from enrollment record with enrollment type (ordered by priority):
1) S, W - the first record after the survey period end date;
2) E, Y - the last record before or on the survey period end date;
3) record after the survey period end date, if there are no records before the survey period end date;
If 'stdYog' is not equal to 'enrYog', 'enrYog' is used to calculate grade level state reference code, otherwise 'stdGradeLevel' is used.
